import React, { useCallback, useState } from 'react';
import ReactFlow, {
  MiniMap,
  Controls,
  Background,
  useNodesState,
  useEdgesState,
} from 'reactflow';

import 'reactflow/dist/style.css';

const initialNodes = [
  {
    id: 'start',
    position: { x: 300, y: 50 },
    data: { label: 'Start Node' },
    style: {
      background: '##969292', // Green background for Start Node
      padding: 10,
      borderRadius: 10, // Rounded corners
      color: 'white',
      border: '1px solid #4caf50', // Border to match the background color
    },
  },
  {
    id: 'end',
    position: { x: 300, y: 400 },
    data: { label: 'End Node' },
    style: {
      background: '#ff7043', // Orange background for End Node
      padding: 10,
      borderRadius: 10, // Rounded corners
      color: 'white',
      border: '1px solid #ff7043', // Border to match the background color
    },
  },
];

const initialEdges = [
  { id: 'start->end', type: 'custom-edge', source: 'start', target: 'end' },
];

export default function App() {
  const [nodes, setNodes, onNodesChange] = useNodesState(initialNodes);
  const [edges, setEdges, onEdgesChange] = useEdgesState(initialEdges);
  const [nodeCount, setNodeCount] = useState(0); // To generate unique node IDs
  const [showNodeTypeSelector, setShowNodeTypeSelector] = useState(false); // To toggle the node type selector

  // Function to handle adding a new node
  const addNodeHandler = (type) => {
    const newNodeId = `node-${nodeCount}`;
    const newNode = {
      id: newNodeId,
      position: { x: 300, y: 100 + nodeCount * 100 }, // Position below the previous node
      data: { label: type === 'action' ? 'Action Node' : 'If/Else Node' },
      style: {
        background: type === 'action' ? '#a0d911' : '#ffa940',
        padding: 10,
        borderRadius: 10, // Rounded corners
      },
    };

    // Add the new node
    setNodes((nds) => [...nds, newNode]);

    // Connect the new node to the previous node and the end node
    const newEdges = [
      {
        id: `e-${nodes[nodes.length - 1].id}-${newNodeId}`,
        source: nodes[nodes.length - 1].id, // Connect to the last node
        target: newNodeId,
        type: 'smoothstep',
        animated: true,
        style: { stroke: '#1890ff', strokeWidth: 2 },
      },
      {
        id: `e-${newNodeId}-end`,
        source: newNodeId,
        target: 'end', // Connect to the end node
        type: 'smoothstep',
        animated: true,
        style: { stroke: '#1890ff', strokeWidth: 2 },
      },
    ];

    // Remove the old edge to the end node and add the new edges
    setEdges((eds) => [
      ...eds.filter((edge) => edge.target !== 'end'),
      ...newEdges,
    ]);

    // Increment node count
    setNodeCount(nodeCount + 1);
    setShowNodeTypeSelector(false); // Hide the node type selector
  };

  return (
    <div style={{ width: '100vw', height: '100vh' }}>
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        fitView
      >
        <Controls />
        <MiniMap />
        <Background variant="dots" gap={12} size={1} />
      </ReactFlow>

      {/* Add Node Button */}
      <button
        onClick={() => setShowNodeTypeSelector(true)}
        style={{
          position: 'absolute',
          top: '20px',
          left: '20px',
          padding: '10px',
          backgroundColor: '#007bff',
          color: 'white',
          border: 'none',
          borderRadius: '5px',
          cursor: 'pointer',
        }}
      >
        Add Node
      </button>

      {/* Node Type Selector */}
      {showNodeTypeSelector && (
        <div
          style={{
            position: 'absolute',
            top: '60px',
            left: '20px',
            padding: '10px',
            backgroundColor: 'white',
            border: '1px solid #ccc',
            borderRadius: '5px',
            boxShadow: '0 2px 5px rgba(0, 0, 0, 0.2)',
          }}
        >
          <p style={{ margin: '0 0 10px', fontWeight: 'bold' }}>
            Select Node Type:
          </p>
          <button
            onClick={() => addNodeHandler('action')}
            style={{
              display: 'block',
              width: '100%',
              padding: '10px',
              marginBottom: '5px',
              backgroundColor: '#a0d911',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
            }}
          >
            Action Node
          </button>
          <button
            onClick={() => addNodeHandler('ifelse')}
            style={{
              display: 'block',
              width: '100%',
              padding: '10px',
              backgroundColor: '#ffa940',
              color: 'white',
              border: 'none',
              borderRadius: '5px',
              cursor: 'pointer',
            }}
          >
            If/Else Node
          </button>
        </div>
      )}
    </div>
  );
}
